import stripeActionsTypes from "./Stripe.ActionsTypes";
const INITIAL_STATE = {
  error: null,
  mama: "lola",
};
const StripeReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case stripeActionsTypes.PAYMENT_START:
      console.log("mama");
      return { ...state };

      break;

    default:
      break;
  }
};
export default StripeReducer;
